import React, { useState } from 'react';
import { Box, Typography, Grid, TextField, MenuItem, IconButton, Chip } from '@mui/material';
import { styled } from '@mui/system';
import FilterListIcon from '@mui/icons-material/FilterList';
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';

// Import the images
import s1s from '../assets/s1.jpg';
import s2s from '../assets/s2.jpg';
import s3s from '../assets/s3.jpg';
import s4s from '../assets/s4.jpg';
import s5s from '../assets/s5.jpg';
import s6s from '../assets/s6.jpg';
import s7s from '../assets/s7.jpg';
import s8s from '../assets/s8.jpg';
import s9s from '../assets/s9.jpg';

// Updated data with Baa M Boo branding
const mensClothingItems = [
  { name: 'Mesh Elite Shirt - All Fits', brand: 'Baa M Boo', price: '$100.00', discountedPrice: '$69.89', image: s1s, colors: 47, type: 'shirt' },
  { name: 'Oxford Premium Shirt - All Fits', brand: 'Baa M Boo', price: '$126.00', discountedPrice: '$99.89', image: s2s, colors: null, type: 'shirt' },
  { name: 'Textured Luxe Sweater', brand: 'Baa M Boo', price: '$125.00', image: s3s, colors: 5, type: 'sweater' },
  { name: 'Mesh Elite Shirt - All Fits', brand: 'Baa M Boo', price: '$100.00', discountedPrice: '$69.89', image: s4s, colors: 47, type: 'shirt' },
  { name: 'Oxford Premium Shirt - All Fits', brand: 'Baa M Boo', price: '$126.00', discountedPrice: '$99.89', image: s5s, colors: null, type: 'shirt' },
  { name: 'Textured Luxe Sweater', brand: 'Baa M Boo', price: '$125.00', image: s6s, colors: 5, type: 'sweater' },
  { name: 'Mesh Elite Shirt - All Fits', brand: 'Baa M Boo', price: '$100.00', discountedPrice: '$69.89', image: s7s, colors: 47, type: 'shirt' },
  { name: 'Oxford Premium Shirt - All Fits', brand: 'Baa M Boo', price: '$126.00', discountedPrice: '$99.89', image: s8s, colors: null, type: 'shirt' },
  { name: 'Textured Luxe Sweater', brand: 'Baa M Boo', price: '$125.00', image: s9s, colors: 5, type: 'sweater' },
];

// Styled components to match the image's style
const ItemImage = styled('img')({
  width: '100%',
  height: '500px',
  objectFit: 'cover',
  borderRadius: '0px',
  transition: 'all 0.3s ease-in-out',
  '&:hover': { opacity: 0.95 },
});

const FilterBox = styled(Box)({
  display: 'flex',
  justifyContent: 'flex-end',
  padding: '10px 0',
  marginBottom: '20px',
});

const FilterTypography = styled(Typography)({
  fontFamily: "'Arial', sans-serif",
  fontSize: '14px',
  fontWeight: 600,
  color: '#003087',
  textTransform: 'uppercase',
  display: 'flex',
  alignItems: 'center',
  cursor: 'pointer',
});

const ItemBox = styled(Box)({
  position: 'relative',
  padding: '10px',
  backgroundColor: '#fff',
  border: '1px solid #e0e0e0',
  borderRadius: '0px',
  transition: 'all 0.3s ease-in-out',
  '&:hover': {
    borderColor: '#ccc',
  },
});

const QuickShopButton = styled(Box)({
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  backgroundColor: '#fff',
  border: '1px solid #003087',
  padding: '8px 16px',
  fontSize: '12px',
  fontWeight: 600,
  color: '#003087',
  textTransform: 'uppercase',
  opacity: 0,
  transition: 'opacity 0.3s ease-in-out',
  cursor: 'pointer',
  '&:hover': {
    backgroundColor: '#f5f5f5',
  },
});

const ColorDots = styled(Box)({
  display: 'flex',
  gap: '5px',
  marginTop: '5px',
});

const ColorDot = styled(Box)({
  width: '12px',
  height: '12px',
  borderRadius: '50%',
  border: '1px solid #e0e0e0',
});

const MensPage = () => {
  const [filterType, setFilterType] = useState('all');
  const [priceRange, setPriceRange] = useState('all');
  const [showQuickShop, setShowQuickShop] = useState(null);

  const filteredItems = mensClothingItems.filter(item => {
    const matchesType = filterType === 'all' || item.type === filterType;
    const matchesPrice = priceRange === 'all' ||
      (priceRange === 'under100' && parseFloat(item.price.slice(1)) < 100) ||
      (priceRange === '100to150' && parseFloat(item.price.slice(1)) >= 100 && parseFloat(item.price.slice(1)) <= 150);
    return matchesType && matchesPrice;
  }).slice(0, 4);

  return (
    <Box sx={{ padding: '20px', maxWidth: '1440px', margin: '0 auto' }}>
      {/* Page Header */}
      <Typography variant="h4" sx={{ fontWeight: 'bold', marginBottom: '10px', fontFamily: "'Arial', sans-serif", textTransform: 'uppercase' }}>
        Men's Clothing
      </Typography>

      {/* Highlighted Category */}
      <Typography variant="h6" sx={{ marginBottom: '20px', fontWeight: 'bold', fontFamily: "'Arial', sans-serif", color: '#003087', textTransform: 'uppercase' }}>
        Mesh Elite Shirt - All Fits
      </Typography>

      {/* Smart Filtering */}
      <FilterBox>
        <Box sx={{ display: 'flex', gap: 2, alignItems: 'center' }}>
          <FilterTypography>
            <FilterListIcon sx={{ fontSize: '18px', mr: 1 }} />
            Filter & Sort
          </FilterTypography>
          <TextField
            select
            value={filterType}
            onChange={(e) => setFilterType(e.target.value)}
            sx={{ minWidth: 150 }}
            size="small"
          >
            <MenuItem value="all">All Items</MenuItem>
            <MenuItem value="shirt">Shirts</MenuItem>
            <MenuItem value="sweater">Sweaters</MenuItem>
          </TextField>
          <TextField
            select
            value={priceRange}
            onChange={(e) => setPriceRange(e.target.value)}
            sx={{ minWidth: 150 }}
            size="small"
          >
            <MenuItem value="all">All Prices</MenuItem>
            <MenuItem value="under100">Under $100</MenuItem>
            <MenuItem value="100to150">$100 - $150</MenuItem>
          </TextField>
        </Box>
      </FilterBox>

      {/* Clothing Items Grid */}
      <Grid container spacing={2}>
        {filteredItems.map((item, index) => (
          <Grid item xs={12} sm={6} md={3} key={index}>
            <ItemBox
              onMouseEnter={() => setShowQuickShop(index)}
              onMouseLeave={() => setShowQuickShop(null)}
            >
              <ItemImage src={item.image} alt={item.name} />
              {showQuickShop === index && (
                <QuickShopButton>
                  Quick Shop
                </QuickShopButton>
              )}
              <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mt: 1 }}>
                <Box>
                  {item.colors && Array.from({ length: Math.min(item.colors, 3) }).map((_, i) => (
                    <ColorDot key={i} sx={{ backgroundColor: i % 2 === 0 ? '#000' : i % 3 === 0 ? '#003087' : '#ccc' }} />
                  ))}
                  {item.colors && (
                    <Typography variant="body2" sx={{ fontSize: '12px', ml: 1 }}>
                      + {item.colors}
                    </Typography>
                  )}
                </Box>
                <IconButton size="small">
                  <FavoriteBorderIcon sx={{ fontSize: '16px' }} />
                </IconButton>
              </Box>
              <Typography variant="body2" sx={{ fontWeight: 'bold', mt: 1, fontFamily: "'Arial', sans-serif" }}>
                {item.name}
              </Typography>
              <Typography variant="body2" sx={{ color: '#003087', fontFamily: "'Arial', sans-serif" }}>
                {item.brand}
              </Typography>
              <Box sx={{ display: 'flex', gap: '10px', mt: 1 }}>
                <Typography variant="body2" sx={{ textDecoration: item.discountedPrice ? 'line-through' : 'none', color: item.discountedPrice ? '#999' : '#000', fontFamily: "'Arial', sans-serif" }}>
                  {item.price}
                </Typography>
                {item.discountedPrice && (
                  <Typography variant="body2" sx={{ color: '#000', fontWeight: 'bold', fontFamily: "'Arial', sans-serif" }}>
                    {item.discountedPrice}
                  </Typography>
                )}
              </Box>
              {item.colors && (
                <Typography variant="body2" sx={{ color: '#666', fontSize: '12px', mt: 1, fontFamily: "'Arial', sans-serif" }}>
                  {item.colors} colors available
                </Typography>
              )}
            </ItemBox>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default MensPage;
